      'description': ' with Shooter Jennings, Cole Porter Band, Mountain Deer Revival<br> Music is having a moment. Listeners are crying out for something truesome meaty songs that&#39;ll give us some comfort, even as they cut closer to the bone.Everyone is finally ready for the gritty, thundering country Jason Boland and the Stragglers have sharpened over almost 20 years&#39; worth of selling out roomy venues and commanding stages across the nation. And new album Squelch provides the ideal vehicle.&quot;We&#39;re just trying to make something that we&#39;re proud of,&quot; lead songwriter and vocalist Boland says. &quot;If any more people want to take notice of it, they&#39;re welcome.&quot;Since coming together in Stillwater, Oklahoma, Boland and his tightknit crew have sold more than half a million albums independently and earned a devoted following that&#39;s swelled far beyond the band&#39;s red dirt roots. At a Stragglers show, oil patch roughnecks, hippies, college kids, and intelligentsia all sway side-by-side like a traveling reincarnation of Austin&#39;s Armadillo World Headquarters in its cosmic cowboy, Willie Nelson heyday.While the Stragglers draw from rock and folk, make no mistake: they traffic in unfiltered, unfettered honky-tonk, raw and lean. Equal parts subtle, meditative, and snarling, and often wickedly funny, Squelch is a deeply rooted exercise in exhuming beauty by trading smoke and mirrors for what&#39;s real.&quot;We pay homage, but we don&#39;t want to copy or be a throwback act,&quot; Boland says. &quot;All you can do is try to take the music that inspires you and take it further. And make it personal.&quot; If he has felt any pressure to make his &quot;personal&quot; what others have in mind, it doesn&#39;t show. Boland has never constructed an identity or sound for mass or even niche consumption. He is who he is, and he&#39;s all in.Recorded at Orb Recording Studios in Austin and mixed at Sonic Ranch in El Paso, Squelch was produced by Jim Ward (At the Drive-In, Sparta, Sleepercar) and marks the band&#39;s eighth time in the studio. Like two previous Stragglers&#39; albums, debut Pearl Snaps and 2013&#39;s critically acclaimed Dark and Dirty Mile, Squelch was recorded and mixed directly to tape. &quot;It&#39;s one thing when you can say, &#39;Okay, now, engineer, you do your magic,&#39;&quot; Boland says. &quot;There is no magic when you record and mix to tape. It is what it is. I think it&#39;s a fuller, richer sound. And it&#39;s just more honest.&quot;Opener &quot;Break 19&quot; thumps brazenly, reveling in bassist Grant Tracy&#39;s heart-pounding walks and punctuated by Nick Worley&#39;s whirling fiddle, Brad Rice&#39;s locomotive drumming, and newest Straggler Cody Angel&#39;s achy pedal steel. There&#39;s not a throwaway line to be found, as Boland&#39;s deep baritone rumbles through a sly takedown of modern media and absolute certainty after copping to trying it all the wrong way first and realizing &quot;the more I see, the less I claim to know.&quot; It&#39;s a fitting introduction to The Stragglers&#39; signature blend of social consciousness, self-awareness, and swing.&quot;I Guess It&#39;s Alright&quot; is classic Boland wordplay layered over a breakneck shot of adrenaline. A rollicking sendup of society&#39;s uneven tolerance for bad behavior, the track roars that for those with power, life is open season and consequences are nil. &quot;I guess it&#39;s alright to be an asshole if you&#39;re good,&quot; he pounds over growling guitar. &quot;Fat and Merry&quot; bristles with snark, taking aim at quintessentially American hustle, from suburban flight and gentrification, to waste and nonstop consumption. It&#39;s got to be the only song ever to bemoan &quot;coffee shops and escalades where escalades and cocaine could be found&quot; with a world-weary fiddle echo. &quot;Nobody wants to come off as judgmental, but you have to make judgments,&quot; Boland says. &quot;With your tongue in your cheek is a nice way to do it. None of us are above reproach. We&#39;re all just having a good day or a bad day, same as everybody else.&quot;&quot;First to Know&quot; is a love song for adults. &quot;If my voice sounds scared and frozen, it&#39;s because I&#39;m afraid and cold / And when I am you&#39;ll always be the first to know,&quot; Boland sings, both as an ode to the one who knows him best and a plea for understanding. It&#39;s also a reminder that sometimes, what you see really is what you get, and while that may occasionally disappoint, ultimately, it&#39;s cause for trust and hope.Aversion to artifice permeates Squelch in just about every way, from the recording process to the album&#39;s themes to Boland himself. &quot;Lose Early&quot; is a sauntering rendition of dust to dust and a skewering of the lie that you have to sell your soul to eat, while &quot;Do You Love Me Any Less&quot; questions whether or not absence hinders affection. Written by original Stragglers fiddler Dana Hazzard, haunting and heartbreaking &quot;Christmas in Huntsville&quot; is the only track Boland didn&#39;t pen. Images of Christmas at home flood the imprisoned narrator&#39;s mind as he heads to his holiday-timed execution for a murder he didn&#39;t commit. Closer &quot;Fuck, Fight, and Rodeo&quot; kicks out the footlights in a two-minute, hell-in-a-hand-basket hoedown.Asked why he feels so compelled to focus on lost causes and society&#39;s ills, Boland explains, &quot;Because we&#39;ve talked about the rest of it. It&#39;s almost out of obligationand it&#39;s an obligation that&#39;s more intense because of the fact that nobody else is talking about itsome rock, rap, Americana, and folk does. But nobody is doing it the way we do it.&quot;Boland just exited his 30s, but he seems older, based on his experiences. He&#39;s lived through alcoholism, a should-have-killed-him car crash, a ruptured vocal chord, and other trials. He wears his hard-won wisdom easily, without ceremony or conceit, and has evolved naturally as a writer, becoming more and more comfortable with his knack for recognizing the universally significanteven divinein the ordinary. &quot;Holy Relic Sale&quot; is a stunning example, and one of the songs that makes Boland most proud. &quot;My wife&#39;s got a pair of lucky blue socks,&quot; he says. &quot;One day, we just had an awesome dayeverything went right. We got home, and she pulled the socks out of the dresser and said, &#39;I thought I had these on all day.&#39; It&#39;s the classic story of &#39;it&#39;s not the things.&#39; The things are there to remind you to concentrate on the positive facts of life. The little relics that we have are going to wear out or get lost, but the light and the energy are within you.&quot;On stage, Boland leads a raucous party. Off stage, he&#39;s mellow and warm, often wryly philosophical. But no matter where he is, he&#39;s always grateful. &quot;You play the dimly lit honky tonks of the world and take the music to the people, several at a time,&quot; he says. &quot;Some shows are huge, some shows aren&#39;t. You take the good and the bad and you go down the road. And you think, &#39;Isn&#39;t that what everybody&#39;s going for?&#39; Well no, it&#39;s not. But that&#39;s what we look back on and always smile aboutthe shaky ground that we&#39;ve always been on. The uncertainty of it all.&quot;',
